import React from 'react';

function Playlist({ tracks }) {
  return (
    <div>
      <h2>Your playlist</h2>
      <ul>
        {tracks.map((track) => (
          <li key={track.id}>
            {track.name} by {track.artists.map(artist => artist.name).join(', ')}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Playlist;
